ми СОЖ - https://t.me/balisongknifeflipping\n\nВ видео нож бабочка Atropos Demon.\n\nВсе трюки с ножом бабочкой в плейлисте (флиппинг) -    • Видео  \n\n► СПАСИБО ЗА ПРОСМОТР! Огромное спасибо за лайк, подписку, колокол и коммент=) И мега благодарность за распространение этого видео среди своих друзей в соцсетях)))\n\nЕсли я забыл напомнить в видео, не забывайте хотя бы вы: пожалуйста, смотрите видео полностью, подписывайтесь и ставьте колокольчик на \"всё\", ставьте лайк или диз ближе к концу видео. Пишите коммент минимум из 4 слов. Для поддержки и развития канала это очень важно! Мне нравится вести этот канал, но только в том случае, если это и для вас важно)\n\nКаждый желающий может стать спонсором СОЖ, будет больше обзоров и розыгрышей -    / @arssozh  \n\nProduction Music courtesy of Epidemic Sound\n\n☝ Использование материалов моего канала на любых ресурсах без моего согласия я категорически запрещаю. Кидаю жалобы.\n☝ Я не несу никакой ответственности за все твои действия после просмотра моих видео. Повторяя что-либо показанное мной, ты принимаешь всю ответственность на себя. Соблюдай технику безопасности, неси за себя и за свои действия полную ответственность самостоятельно.\n☝ Будьте культурны и корректно выражайте свои мысли! За личные оскорбления - бан без разговоров. На неадекватов время не трачу.\n\n#флиппинг #balisong #НожБабочка #ReverseBehindThe8Ball #BehindThe8Ball #РеверсШары #flipping","commandRuns":[{"startIndex":169,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CIEDEM2rARgBIhMIyMWjy-D1ggMV6dpPCB13DwWzSN7C0Iy1mrOuTw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnF2dlhTTG0tSi1vZklQNDRWVWowSlZnR2FDQXxBQ3Jtc0tuam9vRDktRVhsNWlsbHZCRExEcXJCa1c2aXlyRnFfelIxYlVKY25vT1AzSXBueS1uZXA1UVlDNDJMaVd5czROekhqbXRWTXdNelhJOTRlTFNBS2xQZndIbnJCT1dsVktheHlNcDBoWFc0SjN2Sm5vVQ\u0026q=https%3A%2F%2Fvk.com%2F%40sittinglifestyle-kakoi-balik-kupit\u0026v=T1zM01GUIV4","
